function renderTable(gw) {
    let data = dataByGW[gw];
    if (!data) return;
    let columns = Object.keys(data[0]).map(c => { return {title: c, data: c}; });
    if ($.fn.DataTable.isDataTable('#gw-table')) {
        $('#gw-table').DataTable().destroy();
        $('#gw-table').remove();
    }
    let table = $('<table id="gw-table" class="display" style="width:100%"></table>');
    $('#table-container').html(table);
    $('#gw-table').DataTable({
        data: data,
        columns: columns,
        paging: false,
        searching: true,
        ordering: false,
        fixedHeader: true
    });
}

});
